var campaignController=angular.module("angularApp.controllers");
campaignController.controller("CampaignCtrl",["$scope","$routeParams",function(b,d){var a,c;b.campaign=d.name||"arcade";b.maps=[];switch(b.campaign){case "puzzle":for(a=1;3>a;a+=1)b.maps.push("campaign/puzzle/puzzle_"+a);break;case "timelimit":for(a=1;3>a;a+=1)b.maps.push("campaign/timeLimit/timelimit_"+a);break;case "tetris":for(a=1;7>a;a+=1)for(c=1;11>c;c+=1)b.maps.push("campaign/tetrisAttack/"+a+"/ta_"+a+"_"+c);break;default:for(a=1;4>a;a+=1)b.maps.push("campaign/arcade/arcade_"+a)}}]);
